import React, { useState, useEffect } from 'react';

const ciudades = [
  { key: 'monterrey', label: 'Monterrey' },
  { key: 'guadalajara', label: 'Guadalajara' },
  { key: 'cdmx', label: 'CDMX' },
  { key: 'cancun', label: 'Cancún' },
  { key: 'palenque', label: 'Palenque' },
  { key: 'puertoVallarta', label: 'Puerto Vallarta' },
  { key: 'veracruz', label: 'Veracruz' },
  { key: 'otras', label: 'Otras regiones' }
];

const DestinosTabs = () => {
  const [ciudadSeleccionada, setCiudadSeleccionada] = useState(ciudades[0].key);
  const [datos, setDatos] = useState([]);
  const [cargando, setCargando] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    setCargando(true);
    setError(null);
    setDatos([]);
    fetch(`/src/data/destinos/${ciudadSeleccionada}.json`)
      .then(res => {
        if (!res.ok) throw new Error('No se pudo cargar el archivo de datos');
        return res.json();
      })
      .then(data => {
        setDatos(data);
        setCargando(false);
      })
      .catch(err => {
        setError('Error al cargar los datos de la ciudad seleccionada.');
        setCargando(false);
      });
  }, [ciudadSeleccionada]);

  return (
    <>
      <div className="category-lightbox-tabs">
        {ciudades.map(ciudad => (
          <button
            key={ciudad.key}
            className={ciudadSeleccionada === ciudad.key ? 'active' : ''}
            onClick={() => setCiudadSeleccionada(ciudad.key)}
          >
            {ciudad.label}
          </button>
        ))}
      </div>
      <div className="category-lightbox-content">
        {cargando && <div className="loading">Cargando destinos...</div>}
        {error && <div className="error">{error}</div>}
        <div className="business-grid">
          {!cargando && !error && datos.map((item) => (
            <div className="business-card" key={item.id}>
              <img src={item.image} alt={item.name} className="business-card-image" />
              <div className="business-card-content">
                <h4>{item.name}</h4>
                <p className="business-description">{item.description}</p>
                {item.tags && (
                  <div className="tags">
                    {item.tags.map((tag, idx) => (
                      <span className="tag" key={idx}>{tag}</span>
                    ))}
                  </div>
                )}
                <div className="card-meta">
                  {item.phone && <div><b>Teléfono:</b> {item.phone}</div>}
                  {item.direccion && <div><b>Dirección:</b> {item.direccion}</div>}
                  {item.web && <div><b>Sitio web:</b> <a href={item.web} target="_blank" rel="noopener noreferrer">{item.web}</a></div>}
                  {item.whats && <div><b>WhatsApp:</b> {item.whats}</div>}
                </div>
                <div className="card-buttons">
                  {item.buttons && item.buttons.map((btn, idx) => (
                    <button key={idx} title={btn.text} className="icon-btn">
                      {btn.icon}
                    </button>
                  ))}
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </>
  );
};

export default DestinosTabs;
